const loadFaceDetectionModels = async () => {
  t0 = performance.now()
  let url = "/faceapi/"
  await faceapi.loadTinyFaceDetectorModel(url)
  await faceapi.loadFaceLandmarkTinyModel(url)
  await faceapi.loadFaceRecognitionModel(url)
  t1 = performance.now()
  console.log('models loaded in ' + (t1 - t0) +'ms');
}

const createFaceMatcher = () => {
  t2 = performance.now()
  let labeledFaceDescriptors = [];
  let donaldDescriptor = createLabeledFaceDescriptor('donald', donaldArray);
  let josephDescriptor = createLabeledFaceDescriptor('joseph', josephArray);
  labeledFaceDescriptors.push(donaldDescriptor, josephDescriptor); 
  t3 = performance.now()
  console.log('matcher created in ' + (t3 - t2) +'ms');
  return new faceapi.FaceMatcher(labeledFaceDescriptors);
}

const createLabeledFaceDescriptor = (name, array) => {
  const descriptorsToFloat32 = (descriptors) => {
    const arrayToFloat32Array = (arr) => {
      return new Float32Array(arr);
    }

    let result = []
    for (let i in descriptors) {
      result.push(arrayToFloat32Array(descriptors[i]))
    }
    return result
  }

  let typedArray = descriptorsToFloat32(array)
  let lfd = new faceapi.LabeledFaceDescriptors(name, typedArray);
  return lfd;
}

const debouncedDetectFacesInImg = (img) => {
  debounce(detectFacesInImg(img), 100)
}

const detectFacesInImg = async (img) => {
  img.style.border = '2px solid yellow'
  if (img.classList.contains('fdt-checked')) return;
  img.classList.add('fdt-checked')

  const tA = performance.now()
  const results = await faceapi
    .detectAllFaces(img, new faceapi.TinyFaceDetectorOptions({ inputSize: 192 }))
    .withFaceLandmarks(true)
    .withFaceDescriptors()
  const tB = performance.now()
  console.log('img faces detected in ' + (tB - tA) +'ms', img.src.slice(0, 30));
  
  let canvas = await createDetectionsCanvas(img, results)
  overlayCanvasOnImg(canvas, img);
  // let tC = performance.now()
  // console.log('canvas stuff done in ' + (tC - tB) +'ms');
}

const overlayCanvasOnImg = (canvas, img) => {
  canvas.style.cssText += "position: absolute; top: 0; left: 0; z-index: 1;"
  let imgStyle = window.getComputedStyle(img);

  if (imgStyle.position === 'absolute') {
    img.before(canvas);
  } 
  else {  
    let wrapper = document.createElement('div');
    wrapper.style.cssText = "position: relative;"
    img.before(wrapper);
    wrapper.appendChild(img);
    img.after(canvas);
  }
}

const createDetectionsCanvas = async (img, detections) => {
  const displaySize = { width: img.width, height: img.height }
  const canvas = document.createElement('canvas')
  faceapi.matchDimensions(canvas, displaySize)

  const resizedDetections = faceapi.resizeResults(detections, displaySize)
  // drawLabelledDetections(canvas, resizedDetections)
  await drawFaceCanvases(img, resizedDetections, canvas)
  return canvas
}

const drawLabelledDetections = (canvasArg, detections) => {
    var detectionsArray = Array.isArray(detections) ? detections : [detections];
    detectionsArray.forEach(function (det) {
        var score = det instanceof faceapi.FaceDetection
            ? det.score
            : (faceapi.isWithFaceDetection(det) ? det.detection.score : undefined);
        var box = det instanceof faceapi.FaceDetection
            ? det.box
            : (faceapi.isWithFaceDetection(det) ? det.detection.box : new faceapi.Box(det));

        let bestMatch = matcher.findBestMatch(det.descriptor).toString();
        let isDon = bestMatch.includes('donald');
        let isJoe = bestMatch.includes('joseph');
        let labelName = bestMatch.includes('unknown') ? "" : bestMatch

        var label = labelName + " " + (score ? "" + Math.round(score*100)/100 : undefined);

        new faceapi.draw.DrawBox(box, { label: label, boxColor: isDon ? 'red' : 'blue' }).draw(canvasArg);
    });
}

const drawFaceCanvases = async (img, detections, canvas) => {
  // const regionsToExtract = [];
  var detectionsArray = Array.isArray(detections) ? detections : [detections];
  detectionsArray.forEach(async (det) => {
    let bestMatch = matcher.findBestMatch(det.descriptor).toString();
    if (bestMatch.includes('donald')) {
      var box = det instanceof faceapi.FaceDetection
        ? det.box
        : (faceapi.isWithFaceDetection(det) ? det.detection.box : new faceapi.Box(det));
      const faceCanvases = await faceapi.extractFaces(img, [box]);
      let ctx = canvas.getContext('2d');
      faceCanvases.forEach(c => {
        pixellateCanvas(c);
        ctx.drawImage(c, box.x, box.y);
      })
    }
  })
}

const pixellateCanvas = (c) => {

  const getPxSize = (c) => {
    let pxSize = 6;
    if (c.height >= 36)
      pxSize = 8;
    if (c.height >= 64)
      pxSize = 16;
    if (c.height >= 108)
      pxSize = 24;
    return pxSize
  }

  let pxSize = getPxSize(c)
  let size = pxSize/(c.height * 4)
      w = c.width * size,
      h = c.height * size;

  // draw the original image at a fraction of the final size
  let clone = c.cloneNode(true);
  clone.getContext('2d').drawImage(c, 0, 0, c.width, c.height, 0, 0, w, h);
  
  let ctx = c.getContext ('2d');
  ctx.clearRect(0, 0, c.width, c.height)

  // turn off image aliasing
  ctx.msImageSmoothingEnabled = false;
  ctx.mozImageSmoothingEnabled = false;
  ctx.webkitImageSmoothingEnabled = false;
  ctx.imageSmoothingEnabled = false;

  // enlarge the minimized image to full size    
  ctx.drawImage(clone, 0, 0, w, h, 0, 0, c.width, c.height);
}

const onImageLoaded = () => {
  let images = document.querySelectorAll('img')
  images = [...images].filter(img => img.complete);
  console.log('onImageLoaded', images)
  images.forEach(img => detectFacesInImg(img))
}

const matcher = createFaceMatcher();
loadFaceDetectionModels();
